import ControlPointIcon from '@material-ui/icons/ControlPoint';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';
import './index.scss';

const useStyles = makeStyles((theme) => ({

}));

export const RegisterThree = () => {
  const classes = useStyles();

  return (
    <div>
      <form className={classes.root} noValidate autoComplete="off">
        <p className='textFb'>Facebook</p>
        <TextField
          variant="outlined"
          margin="normal"
          required
          id="email"
          label="Usuario"
          name="email"
          autoComplete="email"
          className='field'
        />
        <p className='textRs'>Redes Sociales</p>
        <TextField
          variant="outlined"
          margin="normal"
          required
          id="email"
          label="Usuario"
          name="email"
          autoComplete="email"
          className='field'
        />
      </form>
      <ControlPointIcon />
    </div>
  );
}
